INSERT INTO `berita` VALUES ('B0000000001','Bayi Badak Putih Afrika Lahir di Taman Safari Bogor, Diberi Nama Ramadani Jumat Agung','Seekor bayi badak putih Afrika lahir di Taman Safari Bogor dan diberi nama Ramadani Jumat Agung. Kelahirannya tercatat terjadi sekitar pukul 19.59 WIB, dari induk bernama Juma dan pejantan Merdeka. Setelah lahir, bayi badak tersebut langsung berdiri dan menyusu ke induknya secara alami. Pihak pengelola melakukan pemantauan ketat terhadap kesehatan dan perkembangan anak badak itu sejak dini.','','https://www.tempo.co/ramadhan/bayi-badak-putih-afrika-lahir-di-taman-safari-bogor-diberi-nama-ramadani-jumat-agung--199980','TEMPO.CO, Bogor','2023-04-09','B0000000001_Bayi Badak Putih Afrika.jpg','2025-09-27',NULL,NULL,'31.01','KB03','32.01.25-001','D01',NULL),('B0000000002','Keliling Dunia dalam Satu Lokasi di Nicole’s River Park Bogor','Nicole’s River Park Bogor adalah taman rekreasi keluarga dengan konsep “keliling dunia dalam satu lokasi”. Tempat ini menawarkan berbagai zona bertema seperti Nicole’s Castle bergaya Eropa, Deep Sea, Magic Forest, Santorini, Korean Street, Jepang dengan gerbang Torii, hingga Chinatown, lengkap dengan spot foto menarik dan wahana edukatif.\r\n\r\nFasilitasnya cukup lengkap, mulai dari parkiran luas, mushola, toilet, restoran & café, penyewaan kostum, factory outlet, hingga pabrik cokelat (Nicole’s Chocolaterie). Berlokasi di Jalan Yara Puncak – Cianjur No. 57, Megamendung, Bogor, tempat ini buka pukul 08.00–20.00 WIB (hari kerja) dan 07.00–20.00 WIB (akhir pekan), dengan tiket masuk reguler maupun terusan sesuai wahana yang dipilih.','','https://labirutour.com/blog/nicoles-river-park-bogor','Labirutour.com','2023-12-19','B0000000002_Nicole’s River Park Bogor.jpg','2025-09-26',NULL,NULL,'31.01','KB01','32.01.26-001','D01',NULL),('B0000000003','Bogor Juga Punya Kebun Raya Cibinong! Jendela Ekoregion Nusantara di Jantung Sains Indonesia','Kebun Raya Cibinong yang berada di dalam Kompleks Cibinong Science Center – Botanical Garden (CSC-BG), Kabupaten Bogor, memiliki luas sekitar 32 hektare dan dikelola oleh BRIN. Tempat ini awalnya dibuka sebagai taman ekologi pada tahun 2002 dan resmi dibuka untuk umum sebagai kebun raya pada 20 Desember 2019.Kebun raya ini menggunakan pendekatan ekoregion nusantara, di mana koleksi tanaman dikelompokkan berdasarkan asal pulau seperti Sumatra, Jawa, Kalimantan, Sulawesi, Maluku, Nusa Tenggara, hingga Papua. Fasilitas yang tersedia cukup lengkap, mulai dari danau Dora, ecodome, taman bermain, gedung konservasi dan pameran, area tanam, jalur jogging dan bersepeda, spot foto, area parkir, musala, gazebo, hingga pusat informasi tanaman. Harga tiket masuknya Rp15.000 pada hari biasa dan Rp25.000 saat akhir pekan, dengan tarif parkir menyesuaikan jenis kendaraan.','','https://bogor.jawapos.com/teras-bogor/2555886008/bogor-juga-punya-kebun-raya-cibinong-jendela-ekoregion-nusantara-di-jantung-sains-indonesia','Abdul Hamid Dhaifullah','2025-04-16','B0000000003_Kebun Raya Cibinong.jpg','2025-09-26','2025-09-26',NULL,'31.01','KB03','32.01.01-001','D01','D01'),('B0000000004','Curug Panjang di Bogor: Daya Tarik, Harga Tiket, dan Rute','Curug Panjang di Desa Megamendung, Bogor, terkenal karena aliran airnya yang mengalir miring di lereng Gunung Paseban, melewati beberapa curug lain sebelum bermuara. Airnya jernih kebiruan dengan kolam cukup dalam hingga sekitar 6 meter, cocok untuk berenang namun perlu kehati-hatian. Area sekitar curug juga menawarkan camping ground di tengah hutan pinus yang sejuk. Akses menuju curug memerlukan trekking sekitar 10–15 menit dari area parkir. Fasilitas yang tersedia meliputi kamar mandi, mushola, listrik, dan tempat parkir. Harga tiket masuk Rp15.000 per orang, dengan rute dari Jakarta melalui Tol Jagorawi – Puncak – Cilember – Pesantren, berjarak ±68 km dan ditempuh sekitar 1,5 jam.','','https://bandung.kompas.com/read/2023/10/02/215707478/curug-panjang-di-bogor-daya-tarik-harga-tiket-dan-rute?page=all','Dini Danaswari','2023-10-02','B0000000004_Curug Panjang di Bogor.jpg','2025-09-26',NULL,NULL,'31.01','KB03','32.01.26-002','D01',NULL),('B0000000005','Serasa di Negeri Dongeng, Dairyland Riverside Puncak Bogor Tawarkan Tempat Liburan dengan Suasana Berbeda','Dairyland Riverside Puncak Bogor menawarkan pengalaman liburan malam ala negeri dongeng dengan suasana hutan yang “glowing” dan pencahayaan estetik, cocok untuk foto-foto. Selain suasana visual, pengunjung bisa berinteraksi dengan burung hantu, mencoba aktivitas memanah, face painting, dan menikmati berbagai spot instagramable. Tempat ini berlokasi di Jalan Raya Puncak – Gadog KM 77 Ni.435, Leuwimalamg, Cisarua, Kabupaten Bogor. Harga tiket masuknya terjangkau: Rp25.000 untuk Dairyland Resto, dan Rp35.000 untuk Forest Walk. Fasilitas buka mulai pukul 08.00 hingga sekitar 20.30 atau 21.00, tergantung hari (weekday atau weekend).','','https://radarbogor.jawapos.com/wisata/2476287895/serasa-di-negeri-dongeng-dairyland-riverside-puncak-bogor-tawarkan-tempat-liburan-dengan-suasana-berbeda','Yosep Awaludin','2025-06-12','B0000000005_Dairyland Riverside Puncak Bogor.jpeg','2025-09-26',NULL,NULL,'31.01','KB03','32.01.25-006','D01',NULL),('B0000000006','Kulineran di The Lake House Puncak Bogor, Tempat Makan Estetik dengan View Hutan Pinus','The Lake House di kawasan Puncak, Cisarua, Bogor menghadirkan pengalaman kuliner yang berbeda dengan suasana alam tropis yang sejuk. Dikelilingi hutan pinus hijau, restoran ini dirancang dengan estetika modern bergaya rustic menggunakan kayu, kaca besar, dan batu ekspos. Area makan berada di atas kolam buatan sehingga menciptakan sensasi seolah menyantap hidangan di tengah danau.\r\nRestoran ini memiliki tiga lantai dan menawarkan variasi area duduk indoor, outdoor, dan semi terbuka sehingga pengunjung tetap nyaman meski cuaca berubah. Selain itu, The Lake House juga dilengkapi banyak spot foto instagramable di seluruh area, menjadikannya pilihan favorit untuk bersantai, berkumpul bersama keluarga atau teman, serta menikmati wisata kuliner dengan nuansa alam.','','https://www.metrobogor.com/pariwisata/107115712506/kulineran-di-the-lake-house-puncak-bogor-tempat-makan-estetik-dengan-view-hutan-pinus','Araya Dinanty','2025-08-12','B0000000006_Kulineran di The Lake House Puncak Bogor.webp','2025-09-27',NULL,NULL,'31.01','KB01','32.01.25-009','D01',NULL),('B0000000007','Kondisi Kuda Nil di Taman Safari Bogor yang Diberi Makan Sampah Plastik oleh Pengunjung','Seorang pengunjung di Taman Safari Bogor dilaporkan memberi makan sampah plastik kepada seekor kuda nil. Petugas kesehatan hewan bertindak cepat dengan mengeluarkan kantung plastik dari mulut kuda nil tersebut pada Kamis, 20 Juni 2024. Pihak Taman Safari memastikan bahwa kuda nil dalam kondisi sehat setelah mendapatkan perawatan dari tim medis. Mereka juga menyiapkan langkah pencegahan agar kejadian serupa tidak terulang, sekaligus menyelidiki kronologi insiden tersebut.','','https://www.tempo.co/hiburan/kondisi-kuda-nil-di-taman-safari-bogor-yang-diberi-makan-sampah-plastik-oleh-pengunjung-46688','TEMPO.CO, Bogor','2024-06-23','B0000000007_Kondisi Kuda Nil di Taman Safari Bogo.jpg','2025-09-27',NULL,NULL,'31.01','KB03','32.01.25-001','D01',NULL),('B0000000008','Hu Chun, Panda Raksasa di Taman Safari Bogor Berulang Tahun ke-13','Panda raksasa Hu Chun di Taman Safari Bogor merayakan ulang tahun ke-13 pada 9 September 2023. Perayaan berlangsung pada 9–10 September di Istana Panda dengan rangkaian acara seperti face painting untuk pengunjung, sesi talk dari para keeper, kuis, dan pembagian doorprize.\r\nHu Chun adalah salah satu primadona Taman Safari. Ia tiba bersama pasangannya Cai Tao dari Tiongkok pada 28 September 2017 dan telah menjadi daya tarik utama sejak Istana Panda dibuka.','','https://www.tempo.co/hiburan/hu-chun-panda-raksasa-di-taman-safari-bogor-berulang-tahun-ke-13-145277','TEMPO.CO, Bogor','2023-09-11','B0000000008_Hu Chun, Panda Raksasa.jpg','2025-09-27',NULL,NULL,'31.01','KB03','32.01.25-001','D01',NULL),('B0000000009','Serunya Berwisata di Hutan Bercahaya Taman Safari Bogor','Di area ini, pepohonan tinggi dan jalan setapak dihiasi dengan lampu warna-warni serta instalasi cahaya artistik yang tertata rapi, menciptakan atmosfer memikat dan berbeda dari kunjungan siang hari. Cahaya yang berpadu dengan suasana alami hutan menghadirkan kesan magis, membuat pengunjung seolah berada di dunia dongeng.\r\n\r\nSelain menikmati keindahan cahaya, para pengunjung juga diajak berjalan santai menyusuri jalur yang dipenuhi dekorasi tematik. Setiap sudutnya dirancang instagramable sehingga menjadi spot foto menarik bagi keluarga maupun anak muda. Wisata ini tidak hanya menawarkan hiburan visual, tetapi juga menghadirkan pengalaman baru yang menggabungkan rekreasi alam dengan sentuhan seni cahaya modern, menjadikan Hutan Bercahaya sebagai daya tarik malam yang istimewa di Taman Safari Bogor.','','https://www.tempo.co/foto/arsip/serunya-berwisata-di-hutan-bercahaya-taman-safari-bogor-1026224','TEMPO.CO, Bogor','2023-12-24','B0000000009_Serunya Berwisata di Hutan Bercahaya.jpg','2025-09-27',NULL,NULL,'31.01','KB02','32.01.25-001','D01',NULL),('B0000000010','Curug Pariuk Cibeureum Yang Masih Alami','Curug Pariuk, yang terletak di Desa Cibeureum, Kecamatan Cisarua, Bogor, berada dalam kawasan Taman Nasional Gunung Gede Pangrango dan menjadi salah satu sumber air Sungai Ciliwung. Untuk mencapai lokasi, pengunjung melewati kebun teh milik PTPN VIII serta jalur sejauh ±7,1–7,3 km dari titik awal pendakian Rungkun Awi, dimana kendaraan hanya dapat diakses hingga Posko Cimisblung. Setelah itu, perjalanan dilanjutkan melalui jalur kaki menurun hingga Posko 2 dan Posko 3, kemudian menanjak menuju Posko 4 dan akhirnya menyusuri aliran sungai sepanjang ±200–300 m dengan kondisi batu licin dan medan sulit sebelum tiba di curug. Curug ini masih terbilang alami, dikelilingi bukit terjal dan terbatasnya akses memaksa wisatawan untuk berhati-hati, terutama saat kondisi hujan. Tidak terdapat jalur darat alternatif selain menyusuri sungai dari Posko 4, sehingga keselamatan sangat bergantung pada kondisi medan dan kesiapan fisik pengunjung.','','https://bangimam-berbagi.blogspot.com/2023/07/curug-pariuk-cibeureum-yang-masih-alami.html','Bang Imam Berbagi','2023-07-16','B0000000010_Curug Pariuk Cibeureum.jpeg','2025-09-27',NULL,NULL,'31.01','KB01','32.01.25-008','D01',NULL);
