INSERT INTO `kabupaten` VALUES ('31.01','Dikenal dengan julukan Kota Hujan, wilayah ini merupakan penyangga utama Jakarta. Kabupaten Bogor terkenal dengan kawasan Puncak, sebuah destinasi wisata pegunungan yang sejuk dengan hamparan kebun teh, vila, serta Taman Safari Indonesia.','Jl. Tegar Beriman, Tengah, Kec. Cibinong, Kabupaten Bogor, Jawa Barat 16914','31.01_Kantor_Bupati_Bogor.jpg','Kantor Bupati Kabupaten Bogor',NULL,'2025-09-19','32',NULL,'D01','Bogor'),('32.02','Kabupaten ini memiliki bentang alam yang sangat lengkap, dari pegunungan hingga pesisir Samudra Hindia. ','Jl. Siliwangi Palabuhanratu No.10, Pelabuhanratu, Kec. Pelabuhanratu, Kabupaten Sukabumi, Jawa Barat 43364','32.02_Kantor_Bupati_Sukabumi.jpg','Kantor Bupati Kabupaten Sukabumi','2025-09-19','2025-09-19','32','D01','D01','Sukabumi'),('32.03','Cianjur identik sebagai lumbung padi berkualitas tinggi, terutama dengan Beras Pandanwangi yang aromatik dan pulen. ','Jl. KH Abdullah Bin Nuh, Pamoyanan, Kec. Cianjur, Kabupaten Cianjur, Jawa Barat 43211','32.03_Kantor_Bupati_Cianjur.jpg','Kantor Bupati Kabupaten Cianjur','2025-09-19',NULL,'32','D01',NULL,'Cianjur'),('32.04','Mengelilingi Kota Bandung, kabupaten ini adalah surga wisata alam di dataran tinggi Parahyangan. ','Jl. Raya Soreang No.17, Pamekaran, Kec. Soreang, Kabupaten Bandung, Jawa Barat 40912','32.04_Kantor_Bupati_Bandung.jpg','Kantor Bupati Kabupaten Bandung','2025-09-19',NULL,'32','D01',NULL,'Bandung'),('32.05','Dengan julukan \"Swiss van Java\", Garut mempesona dengan pemandangan pegunungan yang indah','Jl. Pembangunan No.185, Sukagalih, Kec. Tarogong Kidul, Kabupaten Garut, Jawa Barat 44151','32.05_Kantor_Bupati_Garut.JPG','Kantor Bupati Kabupaten Garut','2025-09-19',NULL,'32','D01',NULL,'Garut');
