INSERT INTO `kegiatan` VALUES ('E000000001','Cars Meet Out - AEON Mall Sentul City','“Cars Meet Out” menjadi ajang berkumpulnya para penggemar otomotif untuk saling berbagi inspirasi, mempererat silaturahmi, serta menampilkan beragam kendaraan dari berbagai merek dan modifikasi. Suasana penuh semangat dan kebersamaan menghiasi sepanjang acara, yang juga dimeriahkan dengan berbagai kegiatan menarik seperti photo & go, talkshow otomotif, dan sesi hiburan yang banyak membagikan voucher perawatan mobil.','2025-04-26','2025-04-26','E000000001_Cars Meet Out.jpg','https://www.myvalue.id/article/cars-meet-out-2025-sukses-digelar-di-aeon-mall-sentul-city/','2025-09-26',NULL,'31.01','D01',NULL),('E000000002','Festival Melonial Indonesia 2019 - Taman Buah Mekarsari','“Festival Melonial Indonesia” ini akan berlangsung selama 9 hari dengan berbagai macam kegiatan yang akan memanjakan pengunjung Taman Buah Mekarsari yang berlibur. Salah satunya yaitu Melonial Tour, yang akan mengajak pengunjung untuk berwisata dan berkeliling menggunakan kereta wisata mengunjungi langsung kebun buah Melon dan juga mengeksplorasi kebun buah yang sedang panen dimana dengan mengikuti tour ini dapat juga mencicipi buah Melon, menikmati fresh juice, dan mendapatkan edukasi dari aneka buah langka – unik koleksi Taman Buah Mekarsari.','2019-04-06','2019-04-14','E000000002_Festival Melonial Indonesia 2019.png','https://mekarsari.com/web/berita-event/festival-melonial-indonesia-di-taman-buah-mekarsari/','2025-09-26',NULL,'31.01','D01',NULL),('E000000003','Lulabi Beauty Class - Metropolitan Mall Cileungsi','Make Up Class & Mirror Clay Creation','2025-09-28','2025-09-28','E000000003_Lulabi Beauty Class.jpeg','https://metmallcileungsi.com/index.php?r=eventPromotion/event&id=399','2025-09-26',NULL,'31.01','D01',NULL),('E000000004','HUT RI ke-80 - Hotel Purnama','Hotel Purnama, sebuah hotel bintang empat di Kota Batu, turut memeriahkan HUT ke-80 Kemerdekaan RI dengan menggelar beragam lomba internal bagi karyawan serta lomba renang eksternal untuk anak-anak. Seluruh karyawan dari tujuh divisi ikut berpartisipasi dalam perlombaan yang berlangsung di Hall Nawangsasi, mulai dari nail art, face painting, memasak, art towel, art napkin, minuman kreasi, art curving, merangkai bunga, balon twist, hingga video dan fotografi, dengan suasana semakin meriah berkat dukungan para suporter dari tiap divisi. Lomba face painting menjadi salah satu yang paling menarik perhatian dengan berbagai tema seperti binatang dan topeng, sementara lomba art towel menampilkan karya kreatif berupa handuk berbentuk angsa berhadapan yang biasanya diberikan untuk kamar pengantin. Menurut Direktur Hotel Purnama, Willy Suhartanto, kegiatan tahun ini dibuat berbeda dari sebelumnya sebagai bentuk kontribusi rutin hotel dalam merayakan kemerdekaan. Selain itu, Fun Swim Competition bertajuk Purnama Cup 3 yang diadakan pada Sabtu (9/8/2025) di kolam renang hotel juga berlangsung semarak dengan diikuti 185 anak dari berbagai kelompok usia, mulai dari kelahiran 2013 hingga 2019 ke atas.','2025-08-08','2025-08-09','E000000004_HUT RI ke-80.webp','https://www.kliktimes.com/news/72915703866/rayakan-kemerdekaan-hotel-purnama-gelar-lomba-unik-untuk-karyawan-dan-anak-an','2025-09-26',NULL,'31.01','D01',NULL),('E000000005','Mom, Mats, & Minis! - The Lake House','Join SD Mom Walks and Lakehouse Resort for a special Mommy & Me Wellness Event on the lakefront! This fun and energizing morning will feature a family-friendly workout led by Club Pilates, designed to incorporate your little ones into the movement. Finish off the day strong with a Pool Day Pass (add-on) to soak up the sun and make a splash after a great workout! ','2025-10-08','2025-10-08','E000000005_Mom, Mats, & Minis!.jpg','https://www.thelakehouseresort.com/things-to-do-san-marcos/event-calendar','2025-09-26',NULL,'31.01','D01',NULL),('E000000006','Lominous Journey - Taman Safari Indonesia Bogor','Sederhananya, di Luminous Safari Journey ini pengunjung akan dimanjakan oleh pancaran cahaya yang menghiasi di tiga area yaitu Enchanted Forest (Bomboman), Tunnel (Shelter A), dan Taj Mahal visual maping (Baby Zoo).\r\n\r\nKetiga area tersebut dihias dengan pancaran cahaya berupa teknologi digital lampu visual. Area yang sangat menarik dan tak boleh untuk dilewatkan adalah visual maping projection on Taj Mahal. Pada area tersebut, pengunjung akan dibuat terpukau oleh show lighting yang memanfaatkan bentuk bangunan sebagai kanvas.\r\n\r\nPengunjung bisa menikmati pertunjukan lampu berteknologi tersebut dengan dilengkapi sebuah sinopsis tentang harimau putih yang berusaha mempertahankan habitatnya di alam bebas. Sebelum kesitu, pengunjung akan dipandu berkeliling area Taman Safari Bogor menggunakan kereta wisata untuk menikmati Safari Night melihat koleksi satwa yang menarik. Selepas itu pengunjung akan diarahkan untuk memasuki area Luminous Safari Journey dengan berjalan kaki.','2023-12-23','2023-12-31','E000000006_Lominous Journey.jpg','https://tamansafari.com/parade-hutan-menyala-luminous-journey-di-taman-safari-bogor/','2025-09-27',NULL,'31.01','D01',NULL),('E000000007','World Elephant Day 2025 - Taman Safari Indonesia Bogor','Pada World Elephant Day 2025, area Rainforest di Taman Safari Bogor diubah menjadi pusat pembelajaran interaktif. Acara ini dirancang sebagai petualangan edukatif yang menarik, memberi pengunjung kesempatan untuk menyelami dan menghargai dunia gajah—menggambarkan gajah sebagai makhluk raksasa tetapi lembut.','2025-08-12','2025-08-12','E000000007_World Elephant Day 2025.jpg','https://tamansafari.com/taman-safari-bogor/world-elephant-day-2025-menyelami-dunia-raksasa-lembut-indonesia-dalam-petual','2025-09-27',NULL,'31.01','D01',NULL),('E000000008','World Dolphin Day - Taman Safari Indonesia Bogor','Acara ini dirancang sebagai program edukasi interaktif yang menarik perhatian ribuan pengunjung, dengan tujuan meningkatkan kesadaran tentang dunia lumba-lumba dan perlindungan mereka di alam. Beberapa aktivitas yang dihadirkan antara lain Keeper Talk — sesi langsung dengan penjaga satwa yang memberikan wawasan tentang perilaku, habitat, dan tantangan pelestarian lumba-lumba. Melalui acara ini, Taman Safari Bogor berharap pengunjung tidak hanya terhibur, tetapi juga mendapatkan pemahaman lebih mendalam tentang konservasi laut dan peran penting manusia dalam menjaga kehidupan satwa laut.','2025-09-13','2025-09-14','E000000008_World Dolphin Day.jpg','https://tamansafari.com/taman-safari-bogor/world-dolphin-day-2025-di-taman-safari-bogor-sukses-mengedukasi-ribuan-pengun','2025-09-27',NULL,'31.01','D01',NULL),('E000000009','The Picture of Secret Nature - Taman Safari Indonesia Bogor','Taman Safari Bogor menjadi salah satu lokasi roadshow International Animal Photo & Video Competition (IAPVC) 2025 bertema “The Picture of Secret Nature”. Acara ini menghadirkan kompetisi fotografi dan videografi satwa, pameran foto, workshop bersama juri profesional, serta talkshow tentang konservasi dan seni mengabadikan alam. Pengunjung juga dapat mengikuti kategori khusus Roadshow Photo Competition yang hanya tersedia di lokasi. IAPVC 2025 menawarkan berbagai kategori lomba, mulai dari satwa endemik Indonesia, wildlife, remaja, hingga social media foto dan video. Hadiah utama berupa mobil listrik diberikan sebagai simbol komitmen pada gaya hidup ramah lingkungan. Melalui kegiatan ini, Taman Safari Bogor mengajak masyarakat untuk lebih mengenal rahasia alam dan meningkatkan kepedulian terhadap konservasi melalui karya visual.','2025-07-19','2025-07-19','E000000009_The Picture of Secret Nature.jpg','https://tamansafari.com/taman-safari-bogor/menjelajahi-the-picture-of-secret-nature-roadshow-iapvc-2025-ditaman-safari-b','2025-09-27',NULL,'31.01','D01',NULL),('E000000010','Petik Pumpkin - Taman Buah Mekarsari','Pada akhir pekan 26–27 Oktober 2024, Mekarsari menggelar event spesial untuk merayakan Halloween. Dalam rangka acara tersebut, pengunjung yang menjadi 100 orang pertama di jalur Garden Drive Thru mendapatkan kesempatan mengikuti atraksi petik pumpkin (memanen labu) dan juga petik melon. Selain itu, pengunjung yang membeli tiket kelas Reguler B & C dapat mengikuti aktivitas petik belimbing.','2024-10-26','2024-10-27','E000000010_Petik Pumpkin.jpeg','https://mekarsari.com/web/berita-event/petik-pumpkin-pada-halloween-2024/','2025-09-27',NULL,'31.01','D01',NULL);
