INSERT INTO `obyekwisata` VALUES ('32.01.01-001','Kebun Raya Cibinong','Jl. Raya Jakarta-Bogor No.Km. 46, Cibinong, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,29,23.57,-6.48988066077,106,51,15.42,106.85428255366,NULL,'07:00:00.000000','17:00:00.000000',3,NULL,NULL,'Kebun Raya Cibinong merupakan kawasan konservasi botani yang berfungsi sebagai pusat penelitian sekaligus destinasi wisata edukasi. Pengunjung bisa menikmati berbagai jenis tumbuhan tropis yang ditata rapi. Suasananya sejuk, cocok untuk rekreasi sambil belajar mengenai keanekaragaman flora.','KebunRayaCibinong.jpg','2025-09-23','2025-11-03','KW01','32.01.01',NULL,'D01',120),('32.01.01-002','Taman Sampora Legok','Lingkungan Sampora Jl. Kp. Sampora, RT.03/RW.03, Cibinong, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,30,0.45,-6.50012423629,106,51,2.09,106.85058011673,NULL,'06:00:00.000000','18:00:00.000000',5,NULL,NULL,'Taman Sampora Legok adalah ruang terbuka hijau yang sering dimanfaatkan untuk olahraga ringan dan rekreasi keluarga. Area ini memiliki pepohonan rindang dan fasilitas umum sederhana. Suasana tenangnya cocok untuk melepas penat di akhir pekan.','TamanSamporaLegok.jpg','2025-09-23','2025-11-03','KW01','32.01.01',NULL,'D01',120),('32.01.01-003','ITC Cibinong Cirimekar','Jl. Raya Mayor Oking Jaya Atmaja No.28, Cibinong, Kec. Cibinong, Kabupaten Bogor, Jawa Barat 16911',6,28,47.49,-6.47985881350,106,51,48.39,106.86344144782,NULL,'10:00:00.000000','22:00:00.000000',2,NULL,NULL,'ITC Cibinong merupakan pusat perbelanjaan besar yang menjadi ikon kawasan Cirimekar, Bogor. Mall ini menyediakan beragam kebutuhan mulai dari fashion, elektronik, kuliner, hingga pusat grosir dengan harga terjangkau. Selain berbelanja, pengunjung juga bisa menikmati area kuliner dan hiburan, menjadikannya destinasi favorit masyarakat lokal.','ITCCibinongCirimekar.jpg','2025-09-23','2025-11-03','KW01','32.01.01',NULL,'D01',150),('32.01.01-004','Saung Berkah','Jl. HR. Lukman No.2, Cirimekar, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,28,3.32,-6.46758934681,106,51,23.05,106.85640371369,NULL,'10:00:00.000000','21:00:00.000000',4,NULL,NULL,'Saung Berkah adalah restoran yang menyajikan menu khas Sunda dengan konsep rumah makan sederhana. Suasananya nyaman dengan area lesehan yang cocok untuk kumpul keluarga. Harga makanannya terjangkau dengan cita rasa autentik.','SaungBerkah.jpg','2025-09-23','2025-11-03','KW03','32.01.01',NULL,'D01',60),('32.01.01-005','Bakso Sederhana Cibinong','Jl. Raya Mayor Oking Jaya Atmaja No.20, Cirimekar, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,28,26.32,-6.47397767259,106,50,36.53,106.84348024169,NULL,'09:00:00.000000','21:00:00.000000',3,NULL,NULL,'Bakso Sederhana Cibinong merupakan warung bakso populer dengan cita rasa khas yang gurih dan lezat. Tempat ini sering dipadati pengunjung karena terkenal dengan porsi yang pas dan harga ramah di kantong. Cocok untuk wisata kuliner santai bersama teman atau keluarga.','BaksoSederhanaCibinong.jpg','2025-09-23','2025-11-03','KW03','32.01.01',NULL,'D01',60),('32.01.01-006','beHomy Cibinong Suite','Ruko Duta Sentra Cibinong, Jl. Raya Jakarta-Bogor No.Km. 42 Blok A9, Kabupaten Bogor, Jawa Barat',6,28,16.61,-6.47128100109,106,51,1.21,106.85033735231,NULL,'00:00:00.000000','23:35:00.000000',4,NULL,NULL,'beHomy Cibinong Suite adalah penginapan modern dengan fasilitas lengkap untuk wisatawan maupun pebisnis. Kamar-kamarnya nyaman dengan desain minimalis. Lokasinya strategis, dekat dengan pusat kota Cibinong.','beHomyCibinongSuite.jpg','2025-09-23','2025-11-03','KW02','32.01.01',NULL,'D01',0),('32.01.01-007','Sukahati Cafe','Jl. Raya Sukahati No.41, Sukahati, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,29,41.97,-6.49499067915,106,48,42.00,106.81166710051,NULL,'08:00:00.000000','22:00:00.000000',4,NULL,NULL,'Sukahati Cafe adalah tempat nongkrong yang menyajikan menu kopi, makanan ringan, dan makanan berat. Suasananya nyaman dengan dekorasi modern, cocok untuk anak muda. Café ini juga sering digunakan untuk acara kecil seperti gathering atau live music.','SukahatiCafe.jpg','2025-09-23','2025-11-03','KW03','32.01.01',NULL,'D01',60),('32.01.01-008','Bu Sur Homestay','Perum Suryapraja, No.22 Blok A3, Jl. Anang No.22 Blok A3, Sukahati, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,29,2.15,-6.48393110455,106,48,55.21,106.81533498347,NULL,'00:00:00.000000','23:35:00.000000',4,NULL,NULL,'Bu Sur Homestay adalah penginapan sederhana dengan nuansa rumahan yang hangat. Tempat ini cocok untuk wisatawan yang mencari akomodasi murah namun nyaman. Lokasinya mudah dijangkau, dekat dengan area wisata sekitar Cibinong.','BuSurHomestay.jpg','2025-09-23','2025-11-03','KW02','32.01.01',NULL,'D01',0),('32.01.01-009','Taman Cibinong Situ Plaza','Jl. Tegar Beriman No.6, Sukahati, Kec. Cibinong, Kabupaten Bogor, Jawa Barat',6,28,51.46,-6.48096157073,106,49,31.84,106.82550984982,NULL,'06:00:00.000000','18:00:00.000000',4,NULL,NULL,'Taman Cibinong Situ Plaza adalah ruang terbuka hijau dengan danau kecil di tengahnya. Tempat ini sering digunakan masyarakat untuk berolahraga, berjalan santai, atau sekadar bersantai. Udara segar dan suasana tenang membuatnya cocok untuk rekreasi ringan.','TamanCibinongSituPlaza.jpg','2025-09-23','2025-11-03','KW01','32.01.01',NULL,'D01',120),('32.01.03-001','Hotel Grand Orri','Jl. Raya Mayor Oking Jaya Atmaja No.1, Puspasari, Kec. Citeureup, Kabupaten Bogor, Jawa Barat 16810',6,29,2.16,-6.48393300394,106,52,15.77,106.87104798543,NULL,'00:00:00.000000','23:35:00.000000',4,NULL,NULL,'Hotel Grand Orri adalah akomodasi modern yang berlokasi strategis di Citeureup, Bogor. Hotel ini menawarkan kamar nyaman dengan fasilitas standar seperti AC, Wi-Fi, restoran, dan layanan ramah. Suasananya tenang sehingga cocok untuk wisatawan bisnis maupun keluarga yang membutuhkan tempat singgah dekat kawasan industri dan pusat kota.','HotelGrandOrri.jpg','2025-09-23','2025-11-03','KW02',NULL,NULL,'D01',0),('32.01.05-001','AEON MALL Sentul City','Jl. MH. Thamrin, Citaringgul, Kec. Babakan Madang,