-09-23','2025-11-03','KW03','32.01.05',NULL,'D01',60),('32.01.07-001','Taman Buah Mekarsari','Jalan Raya Cileungsi -Jonggol KM.3, Mekarsari, Cileungsi, Kabupaten Bogor, Jawa Barat',6,24,53.14,-6.41476088185,106,59,11.27,106.98646492561,NULL,'09:00:00.000000','16:00:00.000000',4,NULL,NULL,'Taman Buah Mekarsari adalah salah satu taman buah terbesar di Asia Tenggara. Wisatawan dapat belajar tentang budidaya buah, mencicipi hasil kebun, hingga mengikuti aktivitas outbond. Suasana rindang dan asri menjadikannya destinasi keluarga favorit.','TamanBuahMekarsari.jpg','2025-09-23','2025-11-03','KW01','32.01.07',NULL,'D01',120),('32.01.07-002','WATER JOY Harvest City','Perumahan Jl. Harvest City Boulevard, Cipenjo, Kec. Cileungsi, Kabupaten Bogor, Jawa Barat',6,23,33.18,-6.39255120545,106,59,57.20,106.99922201122,NULL,'08:00:00.000000','18:00:00.000000',4,NULL,NULL,'Water Joy adalah wahana wisata air yang berlokasi di kawasan Harvest City. Dilengkapi dengan berbagai kolam renang, seluncuran, dan permainan air, tempat ini sangat cocok untuk anak-anak. Tiket masuknya terjangkau sehingga ramai saat akhir pekan.','WATERJOYHarvestCity.jpg','2025-09-23','2025-11-03','KW01','32.01.07',NULL,'D01',300),('32.01.07-003','Kampung Kuliner Kali Cibarengkok Cileungsi','Kp. Cibarengkok, RT.04/RW.02, Cipeucang, Kec. Cileungsi, Kabupaten Bogor, Jawa Barat',6,25,55.07,-6.43196386912,107,2,23.55,107.03987610734,NULL,'00:00:00.000000','23:35:00.000000',4,NULL,NULL,'Kampung Kuliner Kali Cibarengkok adalah pusat kuliner dengan beragam makanan tradisional dan modern. Suasananya asri karena berada di dekat aliran sungai. Cocok untuk wisata kuliner sambil menikmati suasana alam.','KampungKulinerKaliCibarengkokCileungsi.jpg','2025-09-23','2025-11-03','KW03','32.01.07',NULL,'D01',60),('32.01.07-004','Metropolitan Mall Cileungsi','Jl. Kota Taman Metropolitan, Cileungsi Kidul, Kec. Cileungsi, Kabupaten Bogor, Jawa Barat',6,23,57.95,-6.39942979602,106,58,31.58,106.97543963086,NULL,'10:00:00.000000','22:00: