h satu destinasi wisata populer di Bogor dengan konsep kebun binatang interaktif. Pengunjung dapat melihat hewan dari berbagai belahan dunia secara langsung dari dalam kendaraan. Selain itu, tersedia pula wahana permainan, pertunjukan satwa, serta area konservasi yang edukatif.','TamanSafariIndonesiaBogor.jpg','2025-09-23','2025-11-03','KW01','32.01.25',NULL,'D01',300),('32.01.25-002','Seruni Hotel The Fountains Hotel','Jalan Nasional No.11, Tugu Utara, Cisarua, Kabupaten Bogor, Jawa Barat',6,41,56.45,-6.69901496912,106,57,2.02,106.95056124581,NULL,'00:00:00.000000','23:35:00.000000',5,NULL,NULL,'Hotel Seruni The Fountains menghadirkan konsep penginapan dengan pemandangan pegunungan yang sejuk. Fasilitas yang tersedia meliputi kolam renang tematik, taman, hingga area bermain anak. Hotel ini cocok untuk liburan keluarga karena suasananya nyaman dan jauh dari keramaian kota.','SeruniHotelTheFountainsHotel.jpg','2025-09-23','2025-11-03','KW02','32.01.25',NULL,'D01',0),('32.01.25-003','Kebun Teh Cisarua Bogor','Tugu Sel., Kec. Cisarua, Kabupaten Bogor, Jawa Barat',6,42,0.27,-6.70007515559,106,57,42.11,106.96169806057,NULL,'07:00:00.000000','20:00:00.000000',5,NULL,NULL,'Kebun Teh Cisarua menawarkan pemandangan hamparan perkebunan teh yang hijau dan menenangkan. Udara segarnya sangat cocok untuk refreshing, olahraga ringan, atau sekadar berjalan santai. Wisatawan juga bisa menikmati spot foto indah dengan latar perkebunan dan gunung.','KebunTehCisaruaBogor.jpg','2025-09-23','2025-11-03','KW01','32.01.25',NULL,'D01',120),('32.01.25-004','Taman Wisata Matahari','Jl. Raya Puncak, Cilember, Kec. Cisarua, Kabupaten Bogor, Jawa Barat',6,39,39.66,-6.66101736171,106,55,1.49,106.91708143624,NULL,'11:00:00.000000','17:18:00.000000',3,NULL,NULL,'Taman Wisata Matahari adalah area wisata yang menyediakan fasilitas outbound, penginapan, serta wahana bermain anak. Tempat ini sering menjadi tujuan untuk gathering perusahaan, sekolah, atau acara keluarga besar. Suasana alam yang asri men